import { ActionTypes } from "../constants/action-types";


//create state
const initialState = {
    profiles: [{
        //initial object
        id: 1,
        name: "Jigyashu Nager",
        username: "Jiggy",

    }],
}

export const profileReducer = (state, {type, payload}) => {
    switch (type) {
        case ActionTypes.SET_PROFILES:
            return state;

        default:
            break;
    }
}
